import request from"./request";import{api}from"@/config/index";export default class ApiService{static getApiPre(type){switch(type){case"admin":return api.adminUrl;default:return""}}static qualityInfo(data){return request.post(api.adminUrl+"admin/v1/qualityInfo/page",data)}static warehouseName(){return request.get(api.adminUrl+"admin/v1/quality/warehouse/name/query")}static exportQuality(data){return request.post(api.adminUrl+"admin/v1/qualityInfo/export",data,{responseType:"arraybuffer"})}static addQuality(data){return request.post(api.adminUrl+"admin/v1/qualityInfo/add",data)}static querySnCode(querySnCode,config){return request.get(api.adminUrl+`admin/v1/commodityInfo/querySnCode?snCode=${querySnCode}`,{},config)}static queryCommodityByName(name,config){return request.get(api.adminUrl+`admin/v1/commodityInfo/queryCommodityByName?name=${name}`,{},config)}static queryQualityInspector(name){return request.get(api.adminUrl+`admin/v1/qualityInspector/query?name=${name}`)}static addQualityInfo(data){return request.post(api.adminUrl+"admin/v1/qualityInfo/add",data)}static queryQualityInfo(data){return request.post(api.adminUrl+"admin/v1/qualityInfo/query",data)}static updateQualityInfo(data){return request.post(api.adminUrl+"admin/v1/qualityInfo/update",data)}static flawList(data){return request.post(api.adminUrl+"frontend/v1/quality/app/flaw/list",data)}static flawResult(data,config){return request.post(api.adminUrl+"frontend/v1/quality/app/flaw/result",data,config)}static commodityInfoChecked(data){return request.post(api.adminUrl+"admin/v1/commodityInfo/checked/page",data)}}